import React from 'react'

function groceryList() {
  return (
    <section className="grocery-list">
      <div className="container">
        <div className="content">
          <h3 className="has-text-grey-light">grocery list</h3>
        </div>
      </div>
    </section>
  )
}

export default groceryList
